%[text] # MRI Reconstruction Demo Script
%[text] 
%[text]  ![direction3.gif](text:image:9d7c)
%[text] 
%[text] 
%[text] This demo script showcases the process of MRI reconstruction using k-space data. It is designed to run efficiently on both GPU and CPU, providing three types of visualizations: Volume Rendering, Cinematic Rendering, and Slice Viewer. Additionally, the script generates CUDA code for all three approaches, ensuring high performance and flexibility.
%[text] ## Key Features:
%[text] 1. MRI Reconstruction: Utilizes k-space data to reconstruct MR images and following approaches \
%[text] - MRI Reconstruction Using IFFT and Root Sum Squares
%[text] - Compressed Sensing (CS)
%[text] - MRI Reconstruction Using Deep Learning with U-Net \
%[text]          2\. Multi-platform Execution: Runs on both GPU and CPU.
%[text]          3\. Visualization Options: Offers Volume Rendering, Cinematic Rendering, and Slice Viewer for comprehensive image analysis. 
%[text]          4\. CUDA Code Generation: Generates CUDA code to optimize the reconstruction process
%%
%[text] 
%[text] **Load MRI k-space Data**: First, we load the k-space data from an HDF5 file. The `h5read` function is used to read the specified dataset from the file.
%%
addpath(genpath(pwd)) %adding datafiles and example scripts
%%
% Define URLs and paths
kspaceDataFileURL = 'https://ssd.mathworks.com/supportfiles/medical/M4Raw_sample.zip';
zipFilePath = fullfile(pwd, 'M4Raw_sample.zip');

% Download the ZIP file
websave(zipFilePath, kspaceDataFileURL);

% List contents of the ZIP file
zipContents = unzip(zipFilePath, tempdir);  % Extract to a temporary directory

% Find the first T1 .h5 file
T1Files = dir(fullfile(tempdir, '**', '*T1*.h5'));

if ~isempty(T1Files)
    % Get full path of the first T1 file
    firstT1File = fullfile(T1Files(1).folder, T1Files(1).name);

    % Define destination path
    destinationFile = fullfile(pwd, T1Files(1).name);

    % Copy only the first T1 file to your inputData folder
    copyfile(firstT1File, destinationFile);
else
    warning('No T1 .h5 files found in the archive.');
end

%%

datasetPath = '/kspace';
data =h5read(destinationFile,datasetPath) %[output:2fabc4a4]
%%
%[text] **Set Acceleration Factor**: Define the acceleration factor for undersampling the k-space data. This factor determines the level of undersampling applied during the reconstruction process. *(Applicable only for Compressed Sense (CS) and Deep Learning (DL) methods)*
%Accleration factor
factor =2 %[control:slider:0b93]{"position":[9,10]} %[output:5c28ca47]
%%
%[text] **Perform MRI Reconstruction**: Use the appropriate method from dropdown to perform MRI reconstruction using the loaded k-space data and the specified acceleration factor.
%MRI Reconstruction approach
reconImage = reconstructionWithIFFT(data); %[control:dropdown:63a2]{"position":[14,42]}
%%
%[text] # Visualization of MRI Reconstruction
%[text] Visualizing MRI reconstruction results is crucial for analyzing and interpreting the data. Various visualization techniques can be employed to view and understand the reconstructed images effectively.
%[text] **Medical volume datastore** 
%[text] The [`medicalVolume`](https://www.mathworks.com/help/medical-imaging/ref/medicalvolume.html) function in MATLAB is used to create a medical volume object from image data. This object encapsulates the voxel data and associated metadata, such as the volume's geometry and patient coordinate system
R = medicalref3d(size(reconImage));
medVolReconImage =medicalVolume(reconImage,R);
medVolReconImage.VolumeGeometry.PatientCoordinateSystem ="LPS+";
voxInfo =medVolReconImage.Voxels;
min_val = min(voxInfo(:));
max_val = max(voxInfo(:));
normalized_data = (voxInfo(:) - min_val) / (max_val - min_val);

normalized_data =reshape(normalized_data,[256 256 18]);
newMedVol= medicalVolume(normalized_data,medVolReconImage.VolumeGeometry);

%%
%[text] ## Visualization Methods
%[text] #### Slice View:
%[text] Displays individual slices of the 3D reconstructed image, allowing detailed examination of each slice.
sliceViewer(newMedVol,Parent=figure)
%%
%[text] ### Volume Rendering
%[text] Provides a 3D visualization of the reconstructed image using cinematic rendering, enhancing the depth and detail of the image.
c =bone(20);
volshow(newMedVol,RenderingStyle="CinematicRendering",Colormap=c) %[output:5d6c43cc]
%%
%[text] #### Montage View
%[text] Creates a montage of slices from the 3D reconstructed image, offering a comprehensive overview of the entire volume.
montage(newMedVol) %[output:6fefad97]
%%
%[text] ## GPU Code Generation
%[text] 
%[text] In this section, we will demonstrate how to generate GPU code for the three approaches using respective functions in the drop-down list using MATLAB's GPU Coder. This allows us to leverage the computational power of GPUs to accelerate the processing of k-space data.
%[text] 
%[text] **Steps:**
%[text] **Configuration for GPU Code Generation**: First, we create a configuration object for generating MEX functions that can run on the GPU.
%%
cfg = coder.gpuConfig('mex');
%%
%[text] **Generate GPU Code**: We use the `codegen` command to generate the GPU code for the selected function from drop-down. The `-config cfg` option specifies the configuration object, and the `-args {data}` option provides the input arguments for the function.
%[text] *Please note for compressed sense and Deep learning approaches : the acceleration factor is selected by default 2. You can change it as per your use.*
%[text] 
codegen -config cfg processKspaceCS -args {data} %[control:dropdown:84c0]{"position":[21,36]} %[output:7a094826]
%%
%[text] **Execute the Generated MEX Function**: After generating the GPU code, we can call the MEX function to process the k-space data.
MR_Image = processKspaceCS_mex(data); %[control:dropdown:173e]{"position":[12,37]}
%%
%[text] **Visualize the Reconstructed Images**: Finally, we visualize the reconstructed frames using a loop to display each frame sequentially.
figure; %[output:3a425546]
for frame = 1:18 %[output:group:681e0017]
    imshow(abs(MR_Image(:,:,frame)), []); %[output:3a425546]
    title(sprintf('Reconstructed Frame %d', frame));
    pause(0.5); % Pause for visualization
end %[output:group:681e0017]

